using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using NUnit.Framework;
using EasyDBDriver.Model;
using EasyDBDriver.Tests.Model;
using EasyDBDriver.Model.Query;
using System;
using System.Text.Json;

namespace EasyDBDriver.Tests
{
    public class EasyDbTests
    {
        private readonly string _urlToServer = "https://app-science21-dev.azurewebsites.net/";
        private readonly string _collection = "EasyDBConnectorTest";
        private EasyDbFactory _factory;
        private readonly List<string> _createdElements = new List<string>();

        [SetUp]
        public void Setup()
        {
            _factory = new EasyDbFactory(_urlToServer, "thereIsAlwaysASolution21");
        }

        [TearDown]
        public async Task CleanUpAsync()
        {
            var connector = _factory.GetConnector<TestEntity>(_collection);
            foreach (var e in _createdElements)
            {
                await connector.DeleteAsync(e);
            }
        }

        public async Task CleanUpAllCollection()
        {
            var connector = _factory.GetConnector<TestEntity>(_collection);
            var loadedEntities = await connector.GetCollectionAsync();
            foreach (var e in loadedEntities)
            {
                await connector.DeleteAsync(e);
            }
        }


        [Test(Description = "Add item")]
        public async Task AddTestAsync()
        {
            var connector = _factory.GetConnector<TestEntity>(_collection);
            var e = new TestEntity() { DoubleItem = 2.1, IntItem = 21, ListStringItem = new List<string>() { "21", "TwentyOne" } };

            var newE = await connector.AddAsync(e);

            Assert.IsNotNull(newE.Id, "Object has not Id");
            _createdElements.Add(newE.Id);

            var loadedEntity = await connector.GetAsync(newE.Id);

            Assert.IsNotNull(loadedEntity, "Added object does not exists in DB");
            Assert.AreNotEqual(newE, loadedEntity, "Object from DB is not same as added object");
        }


        [Test(Description = "Update item")]
        public async Task UpdateTestAsync()
        {
            var connector = _factory.GetConnector<TestEntity>(_collection);
            var e = new TestEntity() { DoubleItem = 2.1, IntItem = 21, ListStringItem = new List<string>() { "21", "TwentyOne" } };
            var newE = await connector.AddAsync(e);
            Assert.IsNotNull(newE.Id, "Object has not Id");
            _createdElements.Add(newE.Id);

            newE.DoubleItem = 21.21;
            newE.IntItem = 12;

            await connector.UpdateAsync(newE);

            var loadedEntity = await connector.GetAsync(newE.Id);

            Assert.IsNotNull(loadedEntity, "Added object does not exists in DB");
            Assert.AreNotEqual(newE, loadedEntity, "Object from DB is not same as added object");
        }

        [Test(Description = "Delete item")]
        public async Task DeleteTestAsync()
        {
            var connector = _factory.GetConnector<TestEntity>(_collection);
            var e = new TestEntity() { DoubleItem = 2.1, IntItem = 21, ListStringItem = new List<string>() { "21", "TwentyOne" } };
            var newE = await connector.AddAsync(e);

            Assert.IsNotNull(newE.Id, "Object has not Id");
            _createdElements.Add(newE.Id);

            await connector.DeleteAsync(newE);

            var loadedEntity = await connector.GetAsync(newE.Id);

            Assert.IsNull(loadedEntity, "Deleted object does exists in DB");
        }

        [Test(Description = "Get Collection")]
        public async Task GetCollectionTestAsync()
        {
            var connector = _factory.GetConnector<TestEntity>(_collection);
            var list = new List<TestEntity>();

            for (int i = 0; i < 21; i++)
            {
                var e = new TestEntity() { DoubleItem = i * 2.1, IntItem = 21, ListStringItem = new List<string>() { "21", "TwentyOne", i.ToString() } };
                var newE = await connector.AddAsync(e);
                _createdElements.Add(newE.Id);
                list.Add(newE);
            }

            var loadedEntities = await connector.GetCollectionAsync();

            foreach (var entity in list)
            {
                var loaded = loadedEntities.Where(e => entity.Id == e.Id).ToArray();
                Assert.AreEqual(1, loaded.Count(), "Database has more entities with same id");
                Assert.AreEqual(JsonSerializer.Serialize(entity), JsonSerializer.Serialize(loaded.First()));
            }
        }

        [Test(Description = "Test query")]
        public async Task QueryTestAsync()
        {
            var connector = _factory.GetConnector<TestEntity>(_collection);
            var list = new List<TestEntity>();

            var key = $"QueryTest{Guid.NewGuid()}";

            for (int i = 0; i < 21; i++)
            {
                var e = new TestEntity() { DoubleItem = i * 2.1, IntItem = i, StringItem = key, ListStringItem = new List<string>() { "21", "TwentyOne", i.ToString() } };
                var newE = await connector.AddAsync(e);
                _createdElements.Add(newE.Id);
                list.Add(newE);
            }

            var query = FilterExtension.And(new[]{
                Filter<TestEntity>.Field(e => e.StringItem).Equal(key),
                Filter<TestEntity>.Field(e => e.IntItem).Greater(12)
                });
            var loadedEntities = await connector.GetCollectionAsync(query);

            foreach (var entity in list.FindAll(e => e.IntItem > 12))
            {
                var loaded = loadedEntities.Where(e => entity.Id == e.Id).ToArray();
                Assert.AreEqual(1, loaded.Count(), "Database has more entities with same id");
                Assert.AreEqual(JsonSerializer.Serialize(entity), JsonSerializer.Serialize(loaded.First()));
            }
        }

        [Test(Description = "Safe File")]
        public async Task SaveLoadFileTestAsync()
        {
            var connector = _factory.GetConnector<TestEntity>(_collection);
            var e = new TestEntity()
            {
                DoubleItem = 2.1,
                IntItem = 21,
                ListStringItem = new List<string>() { "21", "TwentyOne" },
                File = new FileModel() { Url = "data:image/png;base64," }
            };

            var newE = await connector.AddAsync(e);
            Assert.IsNotNull(newE.Id, "Object has not Id");
            _createdElements.Add(newE.Id);
        }

        [Test(Description = "QueryWithJsonPropertyName")]
        public void TestQueryWithJsonPropertyName()
        {
            var query = Filter<TestEntity>.Field(e => e.Id).Equal("TestId");
            var stringQuery = query.Render();
            Assert.IsTrue(stringQuery.Contains("_id"),"Query does not contais correct property name");
        }
    }
}